- input: "TEXT\x1CC00135368\x1C.TEXT\x1C\x1CF3XA\x1CIn line 24 of the August 20 monthly
    report, staff time that was not included in the original monthly was added in
    the first amendment.  Ty Dawson was given $66.22 for pro Obama and $66.22 for
    oppose McCain.  Josh Dorner was given $18.15 for pro Norm Coleman.  The additional
    staff time entered on line 24 totals $150.59.  A later amendment made these entries
    into memos to be consistent with our conventions on other amendments.  Also, a
    memo entry for Line 21(b) was added with a value of $150.59.  In the same amendment,
    $3,716 in contributions was added to line 11(a).   In the amendment filed in January
    2009, $500 in receipts on line 11(a)(i) and $1383 in receipts on line 11(a)(ii)
    were deleted.  These receipts were duplicates that were erroneously added in the
    latest amendment."
